import { useEffect, useState} from "react"

const CrossChain = () =>{
  return (
    <Layout>
      <section class="hero">
        <div class="hero-body">
          <div class="container has-text-centered">
            <h1 class="has-text-white title">
              Wan Army
            </h1>
            <h2 class="has-text-white subtitle">
              Wan Troops Unite!
            </h2>
          </div>
        </div>
      </section>
      <style jsx>
        {`
        .title {
          text-align: center;
          margin-bottom: 50px;
        }
      `}
      </style>
    </Layout>
  )
}

export default CrossChain
